  caption: string;
}
interface ProjectProps {
  title: string;
  hours: number;
  pictures: [PictureProps];
}
const Projects: FC = () => {
  const projects: [ProjectProps] = [
    {
      title: 'Deep weeding',
      hours: 50,
      pictures: [{ src: b4, caption: 'Before' }],
    },
  ];

  return <>Sup dog</>;
};

export default Projects;
